					"text": "<p><span style=\"font-size: 14pt;\"><em><strong>B: Boar Pen.</strong></em> The gate to this room is lashed shut with rope. It holds a <a class=\"tooltip-hover monster-tooltip\" href=\"https://www.dndbeyond.com/monsters/16812-boar\" data-tooltip-href=\"//www.dndbeyond.com/monsters/16812-tooltip?disable-webm=1&amp;disable-webm=1\">boar</a> that is the anchorite&rsquo;s companion and garbage disposal. The boar can&rsquo;t harm anyone while trapped in this room. If the gate is opened by anyone other than an <a class=\"tooltip-hover monster-tooltip\" href=\"https://www.dndbeyond.com/monsters/338584-anchorite-of-talos\" data-tooltip-href=\"//www.dndbeyond.com/monsters/338584-tooltip?disable-webm=1&amp;disable-webm=1\">anchorite of Talos</a>, the boar tries to flee the cave, attacking anyone in its path.</span></p>",
